import React from "react";
import ".App.scss";

const App = () => {
  return (
    <div>
      <h1 className="fondo rojo">Es aquí donde empieza todo</h1>
      <div className="fondo">
        <p>Es aquí donde empieza todo</p>
      </div>
    </div>
  );
};

export default App;
